function App() {
  return (
    <Dummy text="Log in bij naam"/>
  );
}

function Dummy(props) {
  return (
    <div className='main'>
    <h1>{ props.text }</h1>
    
    <input type="password" placeholder="password"></input>
    <button>Log in</button>
    </div>
  );
}
function FormInput(props) {
  return (
    <input type={ props.type } placeholder={ props.placeholder }></input> 
  );
}
export default App;
